














































































































































































































































































































































































































































































































































































































































































































































































































































































































































CREATE TABLE public.f_notify_type (
	f_notify_type_id	varchar(255) NOT NULL,
	description     	varchar(255) NOT NULL
	);



CREATE TABLE public.t_notify_note (
    t_notify_note_id    	varchar(255) NOT NULL,
    t_patient_hn        	varchar(255) NOT NULL,
    t_visit_id_rec      	varchar(255) NOT NULL,
    f_notify_type_id    	varchar(255) NOT NULL,
    note_subject        	varchar(255) NOT NULL,
    note_detail         	varchar(4000) NOT NULL,
    active              	varchar(1) NOT NULL DEFAULT '1'::character varying,
    rec_staff           	varchar(255) NOT NULL,
    rec_datetime        	varchar(19) NOT NULL,
    mod_datetime        	varchar(19) NULL,
    del_datetime        	varchar(19) NULL,
    t_visit_id_last_view	varchar(255) NULL,
    notify_count        	numeric NOT NULL,
    PRIMARY KEY(t_notify_note_id)
);



